	}

	render() {
		let {username,password}=this.state
		return (
			<React.Fragment>
				<h3>Login Form</h3>
				<form className="form-group" onSubmit={this.submitHandler}>
					<div className="row">
						<div className="col" />
						<input 
							name="username" 
							type="text" 
							className="form-control col"
							onChange={this.changehandler}
							value={username}
							placeholder="Username"
						/>
						<div className="col" />
					</div>
					<div className="row">
						<div className="col" />
						<input 
							name="password" 
							type="password"
							className="form-control col"
							onChange={this.changehandler}
							value={password}
							placeholder="Password"
						/>
						<div className="col" />
					</div>
					<div className="row">
						<div className="col" />
						<button className="btn btn-primary col" type="submit">
							Login
						</button>
						<div className="col" />
					</div>
				</form>
			</React.Fragment>
		)
	}
}

export default Login
